import React from 'react';

function Product (props){
  //console.log("prop",props.data.id)
    return(
    <div className="widget shadow-sm rounded" onClick={props.handler} id = {props.data.id} style={{borderColor:props.selected?"#4a90e2":"#f9f9f9"}}>
      <h6 onClick={props.handler}>{props.data.name}</h6>
      <span onClick={props.handler}>Price</span>
      <h6 style={{display:"inline-block"}} onClick={props.handler}>{props.data.price}</h6>
      <span onClick={props.handler}className="rightArrow">></span>

    </div>

    )
}

export default Product;
